import React from 'react';
import './nav.css';
import pit from '../img/pit.jpg';


import { BrowserRouter as Router} from "react-router-dom";

class DonorNavbar extends React.Component {

    render() {
    return (<Router>
        <div class="home">
            <div class="nav">
            <ul>
                <li><a class="active" href="/"><img alt="sorry" height="120%" width="15%" src={pit}/></a></li>
                <li><a class="links" href="#contact">Contact</a></li>
                <li><a class="links" href="about">About</a></li>
            </ul>
            </div>
            <div class="about">

            </div>
            <div class="contact">

            </div>    

        </div>
        </Router>
    );
    }
}
export default DonorNavbar;
